{'message': '（￣▽￣）没烂尾哎，我也是毕业之后N年才看懂结局的，大概来说，当时危机三国开印钞将未来透支了，保住了日本，但危机并没有过滤掉，冲击波直达美国，美国开始增信（经济有时候是居民信心的表现，大家觉得好就会好），然后将这危机赶回给日本，三国打算再印钞，但借的债都是假钱，无论如何你得还上假钱，金牙哥跟白毛妹开始直升机甩钱，加上民众对日元信心跌到谷底，等于日元无价值，此时反转印钞机开始还债（其实等于印钞宽松贷币来还之前的债务),日本现在也是这样开始QE，因为老年人多养老压力大，日本的债务比例极高，听说达到GDP的200%以上，人均欠日本政府一个亿日元，唯一办法就是印钞了稀释掉了，比如你以前有房贷欠银行100万，结果政府疯狂印钞的结果导致原来以前欠的100万现在大概50万的购买力就能还上去了，反转之后钱能还上，未来也就回来了，但日元无价值并没有改变，所以国家改用美元了。。

实话实说后面神说的话挺有意思的，没有准确的答案的，大家都正确，三国透支未来获取现在就是妹控之魂，妹妹命不长了，跟活到明天的**谈未来根本就是残忍的，你说今朝有酒今朝醉有点奢侈无计划，但对于没有明天的人来说，谁会在乎呢？

我码这字是2017年，实话实说现在三大泡沫美国股市日本国债中国地产哪个不是过度印钞的结果，就只有美国退出了QE，中国M2一直新高，日本QE通涨不上来就不止步，实质上感觉动画有种预言了日本未来的感觉（也就只能印钞了嘛，但居民信心特别对日元的信心却不会这么容易回来的)', 'plat': 0, 'device': ''}

